                  </div> <div class="a-lg:hidden"><button type="button" class="base-button base-button_theme_blue base-button_view_link"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="36" height="10" xmlns="http://www.w3.org/2000/svg" class="fill-current text-blue-700 icon sprite-icons svg-icon svg-icon_burger"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-burger" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-burger"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div> <div class="flex-1"><div class="relative"><div class="absolute top-0 right-full max-w-[337px] max-h-[210px] w-full h-full translate-x-24 -translate-y-16 pointer-events-none lg:translate-x-12"><div class="absolute inset-0 clip-path-red bg-red-500 rotate-[38deg]"><div class="absolute inset-0 bg-noise opacity-60"></div></div></div> <div class="absolute top-0 left-full max-w-[295px] max-h-[316px] w-full h-full -translate-x-34 pointer-events-none lg:-translate-x-16 md:-top-6 md:translate-x-0 md:max-w-[300px] md:max-h-[320px]"><div class="absolute inset-0 clip-path-purple bg-purple-500 rotate-[49deg]"><div class="absolute inset-0 bg-noise opacity-60"></div></div></div> <div class="container pt-14 pb-20 lg:pb-10"><div><a href="../" class="inline-block fill-current transition-fast cursor-pointer mb-14 hover:text-blue-700 nuxt-link-active"><svg width="20" height="12" xmlns="http://www.w3.org/2000/svg" class="transform scale-reverse icon sprite-icons svg-icon svg-icon_arrow-right"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-arrow-right" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-arrow-right"></use></svg></a> <main><div class="grid grid-cols-12"><div class="col-span-8 lg:col-span-12 mb-14 lg:mb-10"><h1 class="title-h2">ТЗ и бриф на создание фирменного стиля компании. Что это такое, кто готовит, как заполнить?</h1></div> <div class="col-span-12 mb-14 lg:mb-10"><img src="../../_image/i/rs%EF%B9%95fit%EF%B9%951320%EF%B9%95700/format%EF%B9%95jpg/preset%EF%B9%95placeholder/d19fa9b8fd37941e17ef0d3755decb71.jpg" data-src="../../_image/i/rs%EF%B9%95fit%EF%B9%951320%EF%B9%95700/format%EF%B9%95jpg/d19fa9b8fd37941e17ef0d3755decb71.jpg" class="object-cover -lazyload -lazyload-preloader"></div></div> <div class="grid grid-cols-12"><div class="col-span-8 lg:col-span-12  typography typography-old text-lg lg:text-base"><p>Заказчик, который прекрасно разбирается в&nbsp;тонкостях разработки, знает специальные термины и&nbsp;профессиональный сленг, знаком с&nbsp;современными тенденциями в&nbsp;дизайне, понимает, как, зачем и&nbsp;для чего создается фирменный стиль и&nbsp;логотип, встречается так&nbsp;же редко, как розовые пони. То&nbsp;есть в&nbsp;теории такие люди есть, но&nbsp;на&nbsp;практике их&nbsp;никто не&nbsp;видел.</p>
<p>Впрочем, предприниматели и не обязаны разбираться в дизайне. Они должны поставить задачу и оплатить работу специалистов. Все остальное &mdash; зона ответственности брендингового агентства. Но как разработчикам понять требования клиента? Для этого существуют брифы на фирменный стиль, логотип, нейминг и другие работы.</p>
<p>Что такое бриф и для чего он нужен? В чем его отличие от ТЗ? Какие блоки содержит документ? Кто должен его заполнять? Отвечаем!</p>
<h3>Что такое бриф и ТЗ на разработку?</h3>
<p>Очень часто случается так, что заказчики путают ТЗ и бриф на фирменный стиль и логотип. Да что греха таить, даже разработчики зачастую говорят одно, а подразумевают другое. Поэтому прежде чем перейти к назначению и составу рабочей документации необходимо разобраться в терминологии.</p>
<p><strong>Бриф.</strong> Название документа происходит от английского &laquo;brief&raquo;, что в переводе значит &laquo;кратко&raquo;, &laquo;сводка&raquo;, &laquo;резюме&raquo;. По сути, это короткая справка на 2-3 листа, которая дает вводную информацию о компании и продукте, а также о предпочтениях заказчика. На подготовку документа уходит не так много времени, поэтому лучше не пренебрегать его составлением. В зависимости от поставленной задачи различают брифы для создания логотипа и фирменного стиля, брифы на нейминг, брифы на копирайтинг и т.д.</p>
<p><strong>ТЗ&nbsp;(техническое задание).</strong> Объемный документ, описывающий конкретные задачи, пути их&nbsp;решения, а&nbsp;также стадии реализации проекта. К&nbsp;примеру, ТЗ&nbsp;на&nbsp;разработку фирменного стиля или логотипа подробно описывает каждый этап создания айдентики и&nbsp;содержит рабочую информацию. Оно предназначено исключительно для специалистов, которые занимаются проектом.</p>
<p>Бриф заполняет заказчик. Он&nbsp;как никто другой знает особенности компании, товара или услуги, а&nbsp;также собственные пожелания относительно цветовой гаммы, шрифтов и&nbsp;других элементов айдентики. Образец брифа на&nbsp;разработку фирменного стиля можно скачать в&nbsp;сети, но&nbsp;лучше запросить его в&nbsp;агентстве, которое будет работать с&nbsp;проектом. Дело в&nbsp;том, что разные компании требуют различный объем вводной информации. Чтобы в&nbsp;дальнейшем не&nbsp;пришлось тратить время на&nbsp;повторное заполнение документа, сразу попросите исполнителя прислать бриф.</p>
<p>Техническое задание на разработку фирменного стиля или логотипа, равно как и на нейминг или любые другие работы, готовит исполнитель. Как правило, документ содержит несколько десятков страниц. В нем подробно описан каждый элемент, его назначение и задачи, а также порядок реализации проекта. Теоретически образец технического задания на разработку логотипа можно найти в интернете. Но особого смысла в этом нет, поскольку каждый исполнитель работает по собственному ТЗ. А значит, пример вам ничего не даст. Впрочем, готовое ТЗ может быть предоставлено заказчику для ознакомления и согласования. Если вы привыкли максимально контролировать ситуацию, попросите документ у разработчика.</p>
<p><img src="data:image/png;base64,"></p>
<h3>Для чего создают бриф и почему стоит потратить время на его заполнение?</h3>
<p><br>Заполненный бриф на&nbsp;дизайн логотипа или создание фирстиля одновременно решает несколько задач, в&nbsp;том числе:</p>
<ul>
<li>Документ экономит время заказчика на этапе выбора исполнителя. Если у вас есть готовый бриф на разработку логотипа, достаточно отправить его всем претендентам. И не нужно вести долгую переписку и объяснять, что хотите получить.</li>
<li>Бриф упрощает взаимодействие заказчика и&nbsp;исполнителя. Первый сразу обозначает свои требования, второй понимает, на&nbsp;какой результат рассчитывает клиент. Как следствие, уменьшается количество доработок и&nbsp;правок.</li>
<li>Документ помогает сократить подготовительный этап. Если в&nbsp;распоряжении исполнителя будет заполненный бриф, он&nbsp;подготовит&nbsp;ТЗ на&nbsp;разработку фирменного стиля или на&nbsp;создание логотипа и&nbsp;приступит к&nbsp;решению поставленной задачи без долгого уточнения информации.</li>
</ul>
<p>Кроме того, бриф упрощает согласование сроков и&nbsp;стоимости работ. Если вы&nbsp;спросите у&nbsp;разработчика &laquo;Сколько стоит логотип и&nbsp;за&nbsp;какое время вы&nbsp;сможете его разработать&raquo;, то&nbsp;скорее всего получите ответ в&nbsp;формате &laquo;от&nbsp;и&nbsp;до&raquo;. Причем диапазон может быть очень широким. Если вы&nbsp;предоставите бриф и&nbsp;попросите оценить сроки и&nbsp;стоимость, то&nbsp;получите точные цифры.</p>
<h3>Какую информацию дает бриф? Основные блоки и их содержание</h3>
<p>В отличие от технического задания бриф на разработку логотипа, фирменного стиля или названия содержит общую информацию о проекте. Однако это не значит, что к его заполнению можно отнестись спустя рукава. Чем подробнее и точнее вы ответите на вопросы, тем меньше правок вас ждет в будущем.</p>
<p><strong>Блок № 1. Общая информация о компании</strong></p>
<p>Здесь нужно указать название компании, сферу деятельности, краткое описание товаров или услуг, ценовую категорию. Не лишней будет ссылка на сайт, если он у вас есть.<br>Не&nbsp;стоит волноваться, что эта информация дойдет до&nbsp;конкурентов. Во-первых, эти сведения чаще всего общедоступны, а&nbsp;во-вторых, брендинговые агентства дорожат репутацией, поэтому не&nbsp;распространяют конфиденциальные данные.</p>
<p><strong>Блок № 2. Целевая аудитория</strong></p>
<p>Кто ваш клиент, каковы его потребности, какие выгоды он&nbsp;получит от&nbsp;приобретения продукта? Максимально подробно опишите для кого вы&nbsp;работаете. Это необходимо для того, чтобы исполнитель попал в&nbsp;ЦА. Например, бренд производит одежду для новорожденных. В&nbsp;этом случае целевой аудиторией будут молодые женщины, недавно родившие ребенка или готовящиеся стать матерью. В&nbsp;логотипе можно использовать мягкие шрифты, пастельные оттенки, изображения малышей и&nbsp;т.д. А&nbsp;теперь представьте бренд, который тоже выпускает одежду, но&nbsp;для старших школьников. Здесь целевой аудиторией будут не&nbsp;родители, а&nbsp;сами подростки. И&nbsp;конечно, им&nbsp;понравится совсем другой фирменный стиль и&nbsp;логотип.</p>
<p><img src="data:image/png;base64,"></p>
<p><strong>Блок № 3. Информация о конкурентах</strong></p>
<p>Расскажите о&nbsp;конкурирующих организациях. Постарайтесь честно описать, чем их&nbsp;предложение лучше вашего, а&nbsp;чем хуже. Не&nbsp;забудьте о&nbsp;дизайне&nbsp;&mdash; что вам нравится в&nbsp;их&nbsp;айдентике, а&nbsp;что для вас неприемлемо. Желательно указать хотя&nbsp;бы двух-трех конкурентов. Также можно дать ссылки на&nbsp;их&nbsp;сайты. Не&nbsp;волнуйтесь о&nbsp;том, что исполнитель скопирует дизайн. Напротив, обладая этой информацией, разработчик сможет эффективно отстроится от&nbsp;брендов, работающих в&nbsp;одной рыночной нише с&nbsp;вами.</p>
<p><strong>Блок № 4. Подробности заказа</strong></p>
<p>Если вы&nbsp;готовите задание на&nbsp;создание логотипа, то&nbsp;просто опишите свои пожелания. А&nbsp;вот в&nbsp;случае с&nbsp;фирменным стилем необходимо перечислить, какие элементы визуализации бренда вы&nbsp;хотите получить. К&nbsp;примеру, уникальный шрифт, корпоративные цвета, слоган, фирменный персонаж и&nbsp;т.д. В&nbsp;нескольких предложениях опишите все составляющие. Какими вы&nbsp;их&nbsp;видите? На&nbsp;каких носителях они будут размещаться? Образец описания: &laquo;Наши клиенты консервативны. Хотим классический шрифт. Достаточно округлый. Без засечек. Будет использоваться на&nbsp;деловой документации и&nbsp;на&nbsp;рекламной полиграфии&raquo;.</p>
<p><strong>Блок № 5. Информация, которая поможет исполнителю лучше понять задачу</strong></p>
<p>Расскажите, для чего вы&nbsp;заказываете фирменный стиль и&nbsp;каких целей планируете достичь с&nbsp;его помощью. Если у&nbsp;вас уже есть фирстиль, обязательно укажите, почему решились на&nbsp;ребрендинг и&nbsp;каким он&nbsp;должен быть&nbsp;&mdash; кардинальным или легким. Объясните, каким вы&nbsp;представляете себе обновленный дизайн. Например, привычным для целевой аудитории, провокационным, с&nbsp;уклоном в&nbsp;экологичность и&nbsp;т.д. Приведите несколько положительных и&nbsp;отрицательных примеров фирменного стиля или отдельных его элементов. Так дизайнерам будет проще понять ваши вкусы.</p>
<p><img src="data:image/png;base64,"></p>
<p><strong>Блок № 6. Личные пожелания заказчика</strong></p>
<p>При составлении задания на&nbsp;разработку логотипа или фирменного стиля обязательно перечислите общие пожелания к&nbsp;их&nbsp;дизайну. Требования могут быть самыми разными. Кто-то просит, не&nbsp;использовать красный (синий, желтый или любой другой цвет). А&nbsp;кто-то хочет, чтобы дизайн на&nbsp;ассоциативном уровне был связан с&nbsp;респектабельностью, природой или чем-то еще. Важно! Постарайтесь не&nbsp;только перечислить свои пожелания, но&nbsp;и&nbsp;обосновать&nbsp;их.</p>
<p>И&nbsp;еще один момент. Ваше мнение, безусловно, является для вас наиболее ценным. Но&nbsp;может случится так, что дизайн, созданный на&nbsp;его основе, будет противоречить предпочтениям целевой аудитории или идти вразрез с&nbsp;современными тенденциями. Прежде чем категорично настаивать на&nbsp;своем, выслушайте разработчика. Возможно, вы&nbsp;решите отступить и&nbsp;сделаете выбор в&nbsp;пользу предложенного варианта.</p>
<p><strong>Блок № 7. Дополнительная информация</strong></p>
<p>Итак, вы&nbsp;уже почти заполнили бриф на&nbsp;создание фирменного стиля и&nbsp;логотипа компании. Осталось совсем чуть-чуть. Впишите в&nbsp;этот блок любую информацию, которая имеет отношение к&nbsp;вашему бренду, но&nbsp;не&nbsp;была указана в&nbsp;предыдущих пунктах. К&nbsp;примеру, вы&nbsp;планируете в&nbsp;будущем расширить линейку носителей фирстиля. Обязательно укажите это в&nbsp;данном блоке. Или у&nbsp;вас есть собственноручно нарисованные наброски логотипа. Приложите их&nbsp;к&nbsp;брифу или дайте ссылку на&nbsp;электронный вариант. Напишите в&nbsp;этом блоке все, что считаете нужным и&nbsp;важным.</p>
<p><img src="data:image/png;base64,"></p>
