</tr>
<tr style="height: 17px;">
<td style="width: 31.6225%; height: 17px;"><strong>Общие пожелания к&nbsp;дизайну</strong></td>
<td style="width: 68.3775%; height: 17px; border-style: none;">Желательно не&nbsp;использовать в&nbsp;дизайне холодные оттенки. На&nbsp;мой взгляд, они не&nbsp;будут гармонировать с&nbsp;интерьером. Фотографию нашей зоогостиницы прикрепляю. Хочется, чтобы логотип ассоциировался с&nbsp;гостеприимностью, дружелюбностью, любовью к&nbsp;животным.</td>
</tr>
<tr style="height: 17px;">
<td style="width: 31.6225%; height: 17px;"><strong>Дополнительная информация</strong></td>
<td style="width: 68.3775%; height: 17px; border-style: none;">Наша зоогостиница работает 4&nbsp;года. Есть постоянные клиенты. Планируем расширить перечень услуг, а&nbsp;также открыть интернет-магазин амуниции, косметики для животных, инструментов для груминга.</td>
</tr>
</tbody>
</table>
<h3>И&nbsp;в&nbsp;заключение...</h3>
<p>Правильное, подробное заполнение брифа на&nbsp;создание логотипа и&nbsp;фирменного стиля помогает сократить время разработки. А&nbsp;значит, вы&nbsp;быстрее внедрите новые элементы визуализации и&nbsp;начнете продвижение бренда. Возможно, некоторые вопросы покажутся вам слишком банальными, но&nbsp;это не&nbsp;так. Чтобы брендинговое агентство смогло разработать эффектный и&nbsp;эффективный фирстиль, предоставьте специалистам максимальный объем вводной информации.</p>
<p>Остались вопросы? Хотите запросить бриф на&nbsp;разработку логотипа, создание фирменного стиля или нейминг? Свяжитесь с&nbsp;нами через форму на&nbsp;сайте или позвоните: +7 (495) 118-33-14.</p>
