ton_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_telegram"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram"></use></svg></div> <!----> <!----></div></div></button></div> <div class="absolute bottom-0 left-0 z-30"><button type="button" class="shadow-inner-white base-button base-button_theme_green base-button_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_whatsapp"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div></div></div><script>window.__NUXT__=(function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){r.id=77;r.slug=a;r.title=g;r.url=a;r.protocol=c;r.type={code:h,description:"Роут"};r.createdAt="2021-09-30T19:13:44+03:00";r.updatedAt="2021-09-30T19:39:09+03:00";r.meta={title:a,description:a,keywords:a};r.content={id:346,text:a,blocks:[]};r.children=[];return {layout:"default",data:[{post:{title:"ТЗ и бриф на создание фирменного стиля компании. Что это такое, кто готовит, как заполнить?",slug:"tz-i-brif-na-sozdanie-firmennogo-stilya-kompanii-chto-eto-takoe-kto-gotovit-kak-zapolnit",shortDescription:"Заказчик, который прекрасно разбирается в тонкостях разработки, знает специальные термины и профессиональный сленг, знаком с современными тенденциями в дизайне, понимает, как, зачем и для чего создается фирменный стиль и логотип, встречается так же редко, как розовые пони. То есть в теории такие люди есть, но на практике их никто не видел.",createdAt:"2021-11-16T11:46:21+03:00",isImported:f,image:{file:{url:"\u002Fuploads\u002Ffile\u002Fd\u002F1\u002F9\u002Fd19fa9b8fd37941e17ef0d3755decb71.png",name:"d19fa9b8fd37941e17ef0d3755decb71.png",originalName:"avatar.png",extension:"png",size:"532.6 Кб"}},content:{id:441,text:"\u003Cp\u003EЗаказчик, который прекрасно разбирается в&nbsp;тонкостях разработки, знает специальные термины и&nbsp;профессиональный сленг, знаком с&nbsp;современными тенденциями в&nbsp;дизайне, понимает, как, зачем и&nbsp;для чего создается фирменный стиль и&nbsp;логотип, встречается так&nbsp;же редко, как розовые пони. То&nbsp;есть в&nbsp;теории такие люди есть, но&nbsp;на&nbsp;практике их&nbsp;никто не&nbsp;видел.\u003C\u002Fp\u003E\r\n\u003Cp\u003EВпрочем, предприниматели и не обязаны разбираться в дизайне. Они должны поставить задачу и оплатить работу специалистов. Все остальное &mdash; зона ответственности брендингового агентства. Но как разработчикам понять требования клиента? Для этого существуют брифы на фирменный стиль, логотип, нейминг и другие работы.\u003C\u002Fp\u003E\r\n\u003Cp\u003EЧто такое бриф и для чего он нужен? В чем его отличие от ТЗ? Какие блоки содержит документ? Кто должен его заполнять? Отвечаем!\u003C\u002Fp\u003E\r\n\u003Ch3\u003EЧто такое бриф и ТЗ на разработку?\u003C\u002Fh3\u003E\r\n\u003Cp\u003EОчень часто случается так, что заказчики путают ТЗ и бриф на фирменный стиль и логотип. Да что греха таить, даже разработчики зачастую говорят одно, а подразумевают другое. Поэтому прежде чем перейти к назначению и составу рабочей документации необходимо разобраться в терминологии.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EБриф.\u003C\u002Fstrong\u003E Название документа происходит от английского &laquo;brief&raquo;, что в переводе значит &laquo;кратко&raquo;, &laquo;сводка&raquo;, &laquo;резюме&raquo;. По сути, это короткая справка на 2-3 листа, которая дает вводную информацию о компании и продукте, а также о предпочтениях заказчика. На подготовку документа уходит не так много времени, поэтому лучше не пренебрегать его составлением. В зависимости от поставленной задачи различают брифы для создания логотипа и фирменного стиля, брифы на нейминг, брифы на копирайтинг и т.д.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EТЗ&nbsp;(техническое задание).\u003C\u002Fstrong\u003E Объемный документ, описывающий конкретные задачи, пути их&nbsp;решения, а&nbsp;также стадии реализации проекта. К&nbsp;примеру, ТЗ&nbsp;на&nbsp;разработку фирменного стиля или логотипа подробно описывает каждый этап создания айдентики и&nbsp;содержит рабочую информацию. Оно предназначено исключительно для специалистов, которые занимаются проектом.\u003C\u002Fp\u003E\r\n\u003Cp\u003EБриф заполняет заказчик. Он&nbsp;как никто другой знает особенности компании, товара или услуги, а&nbsp;также собственные пожелания относительно цветовой гаммы, шрифтов и&nbsp;других элементов айдентики. Образец брифа на&nbsp;разработку фирменного стиля можно скачать в&nbsp;сети, но&nbsp;лучше запросить его в&nbsp;агентстве, которое будет работать с&nbsp;проектом. Дело в&nbsp;том, что разные компании требуют различный объем вводной информации. Чтобы в&nbsp;дальнейшем не&nbsp;пришлось тратить время на&nbsp;повторное заполнение документа, сразу попросите исполнителя прислать бриф.\u003C\u002Fp\u003E\r\n\u003Cp\u003EТехническое задание на разработку фирменного стиля или логотипа, равно как и на нейминг или любые другие работы, готовит исполнитель. Как правило, документ содержит несколько десятков страниц. В нем подробно описан каждый элемент, его назначение и задачи, а также порядок реализации проекта. Теоретически образец технического задания на разработку логотипа можно найти в интернете. Но особого смысла в этом нет, поскольку каждый исполнитель работает по собственному ТЗ. А значит, пример вам ничего не даст. Впрочем, готовое ТЗ может быть предоставлено заказчику для ознакомления и согласования. Если вы привыкли максимально контролировать ситуацию, попросите документ у разработчика.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAPfrSURBVHgB7P150J3lmed5XkcbkkAgJLQLEIsNxmDATq+ZaeQs5zZZmcZZnZXY0zPA5GR3V01VADFdExUxfwBRPRFVEVMNjpiIyameCqAiqm1nVTeQ1bk6MwEviXfABmx2gVi0IQkESELL6fN9xO\\u002FZXzx\u002Ffi0+cKAW93q1btaswfOsOq1\u002FsBb3e4PX\u002FVrMdu3rd2DDW\u002FvuHOy7863Pnj14sHYOzrNzcM6d+\u002FbVhp139XaWJEmShgywJEnSjLLyqv66wVMeZw9fD8KqQWC1uP\u002FOQ6ljZUP1awNhF69n9QavD9ZDhFxb\u002F1PvwZIkSZpBDLAkSdK09FZQtb7eCqkGQdBlgxBo3RQKqN6TftWDVHENruvBhFt79tSDVm9JkqTpyABLkiSNvWW\u002F179s9uy6bBDmXDp4u346BVXvFMFWHarYutdQS5IkTRcGWJIkaazQo2revFrfm11XDP5F5rJebxBczdCw6ufVVWv1BsFWv+49sL8ecgqiJEkaNwZYkiRpShsJrK6sQz2r9B4MwqydBwdh1uB+3mWgJUmSxoEBliRJmnJWXtVfX7NqffXrijrUx0rH1obBvxXee3B\u002F3f3mm3WvUw4lSdJUY4AlSZJOOKqs5s\u002Fvqquu6M2qK50SeIJRnTWr7tq\u002Fr+6zOkuSJE0FBliSJOmEILRasLCuHoRVBFfrS1PVhn7VXQf31x2GWZIk6UQxwJIkSceNodXYM8ySJEknhAGWJEk6prrQakGtHwQf15Wh1XSyYfC4qfp136av9DaUJEnSMWSAJUmSjgkasfd79blZvbrGnlbTXL\u002FuHfxb5e2bvty7oyRJko4BAyxJknTUOEVwxutWM6yDdbNVWZIk6WgywJIkSe+Z1VZ6G6uyJEnSUWSAJUmS3jWCq8G\u002FTdxYVltpchvKXlmSJOk9MsCSJEnvSDNN8PrB23Ul\u002Fbx6dbvTCyVJ0rthgCVJkn4uBFfzF9b1g395uM5pgnpPDLIkSdI7ZIAlSZKOyOBKx4xBliRJ+jkZYEmSpAkZXOm4oeF71bUGWZIkaTIGWJIk6TAGVzphrMiSJEmTMMCSJEkdgytNGQZZkiRphAGWJEmqlVf1rxn8W8GN5aqCmkoMsiRJ0lsMsCRJmsEGwdX6t4Kr9SVNTRv6B+pLm\u002F+4d2tJkqQZywBLkqQZaBBcrevNqlv6\u002FbqypPGwYfC4adOXe3eUJEmacQywJEmaQexzpbHntEJJkmYkAyxJkmaIt6YL3lb2udJ00O9CrJtKkiTNCAZYkiRNc29VXd0y+Av\u002FNSVNLxsGf66vHQRZ95YkSZrWDLAkSZrGVn2hfz1N2p0uqGnNaYWSJE17BliSJE1DNGl\u002Fa7rg+pJmhg1lk3dJkqYtAyxJkqYZq640o1mNJUnStGSAJUnSNGHVlTS04eCBumHLH\u002FfuKkmSNC3MKkmSNPaW\u002F+P+lb1Z9UAZXklYN2t23bniC\u002F1bSpIkTQtWYEmSNMZYYXDBwrqp36\u002FrStJEWKnwM04plCRpvBlgSZI0ptZ8sX\u002FZgX7dOXi5riQdUf9A3bD5j3u3li