7GuBu1zG1yEnlNCCGEEELIiqHAIoQQQshyuV5gxZQ1n+aTUi\u002FpFUIIIYQQsmQosAghhBBSBZh\u002FdSNukIPFFkJCCCGEkGVAgUUIIYSQZbKwmoj5V7fg5PyvjgKLEEIIIWQZUGARQgghZOUw\u002F+rmODcohBBCCCFkRVBgEUIIIWS59FZ+i+WUkBsTl7+74K9eIYQQQgghS4YCixBCCCErxPKvWGV0E0IO1pgQQgghhJBlQ4FFCCGEkCWTDBzsnf+LLXKL4ET6S\u002FLW07uFEEIIIYQsCQosQgghhKwMF58QcmuYg0UIIYQQsiIosAghhBCyDLK9lV+Zf3V7FuZg5eN2IYQQQgghS4ICixBCCCErgPlXi+G6HKyMaxVCCCGEELIkKLAIIYQQsgySNv+TrXGLx520H0nUK4QQQgghZElQYBFCCCFkGQSB5YKUIbfHyUkhhBBCCCHLggKLEEIIIUsnCm1wcfk1IYsjjtJ91SaEEEIIIWRJUGARQgghZBlYBdYY868Wj9v\u002Fr7CvxubbLwkhhBBCyGKhwCKEEELIcoCEOSlkiVjLJQUWIYQQQsgSocAihBBCyNJJVMIw\u002F2rpIAcrocAihBBCCFkqFFiEEEIIWQaujflXy2A+B4sQQgghhCwBCixCCCGELAvmXy2dkIPFCixCCCGEkCVCgUUIIYSQpeMSyqvl4mRICCGEEELIkqDAIoQQQsjSieNTQpaHS04KIYQQQghZEhRYhBBCCFk6tdGAkOVRTij\\u002FBnfjwn41iV5tAAAAAElFTkSuQmCC\"\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EБлок № 6. Личные пожелания заказчика\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EПри составлении задания на&nbsp;разработку логотипа или фирменного стиля обязательно перечислите общие пожелания к&nbsp;их&nbsp;дизайну. Требования могут быть самыми разными. Кто-то просит, не&nbsp;использовать красный (синий, желтый или любой другой цвет). А&nbsp;кто-то хочет, чтобы дизайн на&nbsp;ассоциативном уровне был связан с&nbsp;респектабельностью, природой или чем-то еще. Важно! Постарайтесь не&nbsp;только перечислить свои пожелания, но&nbsp;и&nbsp;обосновать&nbsp;их.\u003C\u002Fp\u003E\r\n\u003Cp\u003EИ&nbsp;еще один момент. Ваше мнение, безусловно, является для вас наиболее ценным. Но&nbsp;может случится так, что дизайн, созданный на&nbsp;его основе, будет противоречить предпочтениям целевой аудитории или идти вразрез с&nbsp;современными тенденциями. Прежде чем категорично настаивать на&nbsp;своем, выслушайте разработчика. Возможно, вы&nbsp;решите отступить и&nbsp;сделаете выбор в&nbsp;пользу предложенного варианта.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EБлок № 7. Дополнительная информация\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EИтак, вы&nbsp;уже почти заполнили бриф на&nbsp;создание фирменного стиля и&nbsp;логотипа компании. Осталось совсем чуть-чуть. Впишите в&nbsp;этот блок любую информацию, которая имеет отношение к&nbsp;вашему бренду, но&nbsp;не&nbsp;была указана в&nbsp;предыдущих пунктах. К&nbsp;примеру, вы&nbsp;планируете в&nbsp;будущем расширить линейку носителей фирстиля. Обязательно укажите это в&nbsp;данном блоке. Или у&nbsp;вас есть собственноручно нарисованные наброски логотипа. Приложите их&nbsp;к&nbsp;брифу или дайте ссылку на&nbsp;электронный вариант. Напишите в&nbsp;этом блоке все, что считаете нужным и&nbsp;важным.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAvNXSURBVHgB7P0HuJ3leaeLP7tqq\u002FeOhIQoEh2MaDam2dgYYzA4tie2E3t8ksxkMuPM\u002FOdK\u002FieTayZnJjnX5CSTGcdOPHGO7bj3AtgUU0RvokkgIYF6722r7nrW\\u002FyuuGrm5iK1SGuJ9HcUWCIiIiIiItKnQVr97LlJFWk1riSsjlW66kiB0LrhnHXlMUsSRfobCiwRERERERHpc1RLq1pMWb1VSGR98qJVyizpdyiwREREREREpE+AtJq7YmR88\u002FET+5S0eiMymXXjuetCpK+jwBIREREREZFeDeIKafXNJ6b2uvLAIwEzG84+cVv8\u002FhXLTGVJn0WBJSIiIiIiIr0S0laUCd4yb1LIK5DIUmRJX0SBJSIiIiIiIr0KxNXf3z+jX5QJvlUUWdLXUGCJiIiIiIhIr2DtjoHxpz87Q3F1GCiypK+gwBIREREREZGahr5WJK7ocSVvDUWW9HYUWCIiIiIiIlKzfPPxqfH3D8zol83ZjzQ0e\u002F\u002FURSvjUxevCpHehgJLREREREREag76XP3lXafFog1DQ44siKyv\u002FfZTprGkV6HAEhERERERkZrBcsFjByWFv3\u002F50hDpDSiwREREREREpCYgdfWfbjkz1u1oCTk2mMaS3oICS0RERERERI479LqiZFCOD6axpNZRYImIiIiIiMhxY+2OgfGnPzsj5q4cGXJ8mT1te\u002Fz5DQtMY0lNUh8iIiIiIiIixwFKBj\u002Fz9QuUVzVC\u002Fj1snC+1iAJLREREREREjjmUDCJL7HdVW\u002FD3+Mg\u002FXFz+PiK1RGOIiIiIiIiIHEP+8s7TnGWwxqEfWeuBJvtiSc1gAktERERERESOCa37G8ssg8qr3sHf339S\u002FLvvn1P+biLHGwWWiIiIiIiIHHWQIJQM3vLcxJDew32LxpW\u002FG832RY4nCiwRERERERE5qiA\u002Fbv6HS2wO3kvh76bEkuONAktERERERESOGkgPm7X3fvj7KbHkeKLAEhERERERkaOC8qpvocSS44kCS0RERERERI44yqu+iRJLjhcKLBERERERETm