Fh3\u003E\r\n\u003Ctable style=\"border-collapse: collapse; width: 100%; height: 136px; color: black;\" border=\"1\"\u003E\r\n\u003Ctbody\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px; background-color: #f99496; text-align: center;\"\u003E\u003Cstrong\u003EВопрос\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none; background-color: #799979; text-align: center;\"\u003E\u003Cstrong\u003EОтвет\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EУкажите общую информацию о&nbsp;вашей компании.\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003E\r\n\u003Cp\u003EГостиница для животных &laquo;Барбос&raquo;\u003C\u002Fp\u003E\r\n\u003Cp\u003EОказываем услуги передержки, груминга и&nbsp;дрессировки собак, обучаем хозяев хендлингу.\u003Cbr\u003EНаш сайт: https:\u002F\u002FБарбос\u003C\u002Fp\u003E\r\n\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EКто ваша целевая аудитория?\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003E\r\n\u003Cp\u003EСостоятельные владельцы породистых собак, часто уезжающие на&nbsp;отдых и&nbsp;в&nbsp;командировки.\u003C\u002Fp\u003E\r\n\u003Cp\u003EВозраст 30-40&nbsp;лет.\u003C\u002Fp\u003E\r\n\u003Cp\u003EСредний доход от&nbsp;200 тысяч рублей.\u003C\u002Fp\u003E\r\n\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EКто ваши конкуренты?\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003E\r\n\u003Cp\u003EКонкурент №&nbsp;1. Отель для собак &laquo;Жучка&raquo;\u003C\u002Fp\u003E\r\n\u003Cp\u003EНиже цена на&nbsp;груминг и&nbsp;хендлинг. Передержка животных стоит дороже.\u003C\u002Fp\u003E\r\n\u003Cp\u003EКрасивый современный дизайн помещения.\u003C\u002Fp\u003E\r\n\u003Cp\u003EСайт: https:\u002F\u002FЖучка\u003C\u002Fp\u003E\r\n\u003Cp\u003EКонкурент №&nbsp;2. Зоогостиница &laquo;Бобик&raquo;\u003C\u002Fp\u003E\r\n\u003Cp\u003EНе&nbsp;оказывают услуги груминга. Нет дрессировки и&nbsp;хендлинга.\u003C\u002Fp\u003E\r\n\u003Cp\u003EДавно работают на&nbsp;рынке, имеют хорошую репутацию у&nbsp;владельцев животных.\u003Cbr\u003EПринимают на&nbsp;передержку кошек, хорьков и&nbsp;других домашних животных.\u003C\u002Fp\u003E\r\n\u003Cp\u003EСайт: https:\u002F\u002FБобик\u003C\u002Fp\u003E\r\n\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EПодробности заказа\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003EЕсть старый логотип. Нарисован самостоятельно 4&nbsp;года назад. Выглядит непрофессионально.\u003Cbr\u003EХотим новый логотип. Думаем о&nbsp;контурном изображении головы собаки, но&nbsp;готовы обсудить и&nbsp;другие варианты. Предпочтительные цвета: желтый, зеленый, терракотовый.\u003Cbr\u003EЛоготип будет размещаться на&nbsp;сайте, на&nbsp;визитках, на&nbsp;рекламных материалах, на&nbsp;одежде и&nbsp;бейсболках персонала.\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EПомогите нам лучше понять заказ. Расскажите о&nbsp;ваших пожеланиях\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003EПланируем обновить логотип, а&nbsp;в&nbsp;дальнейшем заказать разработку фирменного стиля. Хотим создать положительный имидж и&nbsp;стать узнаваемыми. Конечная цель&nbsp;&mdash; привлечь новых клиентов. Сейчас в&nbsp;зависимости от&nbsp;сезона в&nbsp;гостинице пустует от&nbsp;15&nbsp;до&nbsp;40% мест.\u003Cbr\u003EНравится фирменный стиль зоогостиницы &laquo;Тузик&raquo;\u003Cbr\u003EНе&nbsp;нравится фирменный стиль отеля &laquo;Шарик&raquo;\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EОбщие пожелания к&nbsp;дизайну\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003EЖелательно не&nbsp;использовать в&nbsp;дизайне холодные оттенки. На&nbsp;мой взгляд, они не&nbsp;будут гармонировать с&nbsp;интерьером. Фотографию нашей зоогостиницы прикрепляю. Хочется, чтобы логотип ассоциировался с&nbsp;гостеприимностью, дружелюбностью, любовью к&nbsp;животным.\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr style=\"height: 17px;\"\u003E\r\n\u003Ctd style=\"width: 31.6225%; height: 17px;\"\u003E\u003Cstrong\u003EДополнительная информация\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 68.3775%; height: 17px; border-style: none;\"\u003EНаша зоогостиница работает 4&nbsp;года. Есть постоянные клиенты. Планируем расширить перечень услуг, а&nbsp;также открыть интернет-магазин амуниции, косметики для животных, инструментов для груминга.\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003C\u002Ftbody\u003E\r\n\u003C\u002Ftable\u003E\r\n\u003Ch3\u003EИ&nbsp;в&nbsp;заключение...\u003C\u002Fh3\u003E\r\n\u003Cp\u003EПравильное, подробное заполнение брифа на&nbsp;создание логотипа и&nbsp;фирменного стиля помогает сократить время разработки. А&nbsp;значит, вы&nbsp;быстрее внедрите новые элементы визуализации и&nbsp;начнете продвижение бренда. Возможно, некоторые вопросы покажутся вам слишком банальными, но&nbsp;это не&nbsp;так. Чтобы брендинговое агентство смогло разработать эффектный и&nbsp;эффективный фирстиль, предоставьте специалистам максимальный объем вводной информации.\u003C\u002Fp\u003E\r\n\u003Cp\u003EОстались вопросы? Хотите запросить бриф на&nbsp;разработку логотипа, создание фирменного стиля или нейминг? Свяжитесь с&nbsp;нами через форму на&nbsp;сайте или позвоните: +7 (495) 118-33-14.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAp+nSURBVHgB7L0HuF1neab97Hp611GvVm\u002FuTbaxsU2xCZAEgyEEMoEZ0pj8JAOZTCZlkkBISCABEgjNIYFQbDABAthxw73IktV71zmSTu9t9\u002F993nU+cTC2kWxZPpKee2Zfe++11\\u002F4Z7dNTGQJIYQQQpwrSGAJIYQQQpwgt5\u002FGRuqhefuzeXzH6ZsDz8Pm8UIIIYQQrzQSWEIIIYQQJwgTUbd8OJJLp+Ncz8fpaOZOecVrvf0RCCGEEEK84khgCSGEEEKcIHOaga2HTo\u002FEeqHk05deZoHFa3vN\u002F4mutbYSQgghhBCvOBJYQgghhBAnCRurv5wSi6WKE5u3P5v+kZevmTuvya9t\u002FPx1ElhCCCGEmARIYAkhhBBCnCATZU6QWFwZ8FTzQuWDgZejmfvWg8Br\u002Fuin5dnsZgghhBBCvOJIYAkhhBBCnCC1VT\u002F9nqKHwudUNjpnAuqJHT9\u002FPzZzP5XyjKmvWz5y+hrECyGEEEKcDBJYQgghhBAnyPP1g\u002FrA54GPfxunhI+fRLLqrnU4JbAp\u002FO99\u002FrnllUoIhRBCCDEZkMASQgghhDhB6qqe\u002F7NPfOfUSKwnTqK3FZu5v9TEFOf8\u002F776\u002FJ\u002FXvsA1CyGEEEKcLiSwhBBCCCFOkJ+3Ih8l1p99BS+an9e8\u002FdmwmfvtL6F8kXPlnF8IrUIohBBCiMmABJYQQgghxAlyIuV0X7wbeM\u002Ffv7hkFI89We5+EWWEnNt7PnFi56tTAksIIYQQkwAJLCGEEEKIE+REZQ6lElcoZEP2E4UN2V9MU3Y2c3\u002F8JMoOOSfO7e71EEIIIYQ4Y5DAEkIIIYQ4QU6mnG7roZOTWGyk\u002FmI5URkV5NXWkxBlc6ZACCGEEOIVRwJLCCGEEOJlgv2sTkRi8fM7HsaL5o6Hfn7J4taD43M5iR5bQgghhBCTBQksIYQQQogTZE4zThoKo9f+0QuXB55MCeBzwWbuL5Tg4vi3fOTFyasXc81CCCGEEKcaCSwhhBBCiJcZCqbX\u002FFGUlHouPnEnXjLP18ydqxRSXr2YpvJCCCGEEJMFCSwhhBBCiJNg9ktIJH3g88DHv\u002F3T25iOOhVlfUx4PTvJxXP93ufxolH6SgghhBCTBQksIYQQQojTyCe+89MS6\u002FaX0PvqZ8aekOTiOXguIYQQQoizgSSEEEIIIcQJU1cJtOKlQbHEkr733fzSmrc\u002Fm8d3ROP+6b\u002FZuI\u002FgJaMElhBCCCEmCxJYQgghhBAnQW0lTglfvPvUyqvAa\u002F6PVhoUQgghxNmHSgiFEEIIcVbQ0onTwqlMJfW\u002FDI3VT6W8OlWy7oVgYkwN5oUQQgjx81ACSwghhBBnDZf\u